webpackJsonp([36325666340423],{5929:function(e,t){e.exports={data:{post:{html:'<p>I don\'t know all that much about recent French politics, so I found <a title="Chicago Boyz: Wag Le Dog" href="http://chicagoboyz.blogspot.com/2003_03_01_chicagoboyz_archive.html#90713567">this post</a> by Sylvain Galineau (an expat French citizen in Ireland) at Chicago Boyz most interesting and helpful in explaining the French position on Iraq. In short, it\'s because France pretends it did not lose World War II, and has thus never been able to deal with the aftermath.</p>',fields:{title:"Wag Chirac",date:"15 Mar 2003",url:"https://papascott.de/2003-03-15-wag-chirac/"}}},pathContext:{slug:"/2003-03-15-wag-chirac/",prev:{fields:{title:"Here We Are",date:"14 Mar 2003",slug:"/2003-03-14-here-we-are/"}},next:{fields:{title:"Testing One Two Three",date:"16 Mar 2003",slug:"/2003-03-16-testing-one-two-three/"}}}}}});
